import React, { useState, useEffect } from 'react';
import {
    Table, TableBody, TableCell, TableContainer, TableHead, TableRow,
    Paper, Button, TextField, IconButton
} from '@mui/material';
import {
    Add as AddIcon, Edit as EditIcon, FileCopy as FileCopyIcon,
    Search as SearchIcon
} from '@mui/icons-material';
import axios from 'axios';

const Pacientes = () => {
    const [pacientes, setPacientes] = useState([]);
    const [searchText, setSearchText] = useState('');

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = async (searchText = '') => {
        try {
            const token = localStorage.getItem('token');
            const response = await axios.get('http://localhost:3002/api/persona/listar', {
                headers: {
                    Authorization: `Bearer ${token}`
                },
                params: {
                    texto: searchText
                }
            });
            setPacientes(response.data.data);
        } catch (error) {
            console.error('Error fetching data: ', error);
        }
    };

    const handleSearch = () => {
        fetchData(searchText);
    };

    return (
        <div>
            <h1>Paciente</h1>
            <Button
                variant="contained"
                color="success"
                startIcon={<AddIcon />}
                onClick={() => console.log('Agregar')}
            >
                Agregar
            </Button>
            <div style={{ display: 'flex', alignItems: 'center', marginTop: '1rem' }}>
                <TextField
                    label="Apellido Paterno o Materno o DNI"
                    variant="outlined"
                    value={searchText}
                    onChange={(e) => setSearchText(e.target.value)}
                    size="small"
                    style={{ marginRight: '1rem' }}
                />
                <Button
                    variant="contained"
                    color="primary"
                    startIcon={<SearchIcon />}
                    onClick={handleSearch}
                >
                    Buscar
                </Button>
            </div>
            <TableContainer component={Paper} style={{ marginTop: '1rem' }}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Opciones</TableCell>
                            <TableCell>Apellido Paterno</TableCell>
                            <TableCell>Apellido Materno</TableCell>
                            <TableCell>Nombre</TableCell>
                            <TableCell>Fecha de Nacimiento</TableCell>
                            <TableCell>Sexo</TableCell>
                            <TableCell>Estado Civil</TableCell>
                            <TableCell>Numero de Documento</TableCell>
                            <TableCell>Direccion</TableCell>
                            <TableCell>Tel√©fono</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {pacientes.map((paciente) => (
                            <TableRow key={paciente.idpersona}>
                                <TableCell>
                                    <IconButton
                                        color="warning"
                                        onClick={() => console.log('Editar', paciente.idpersona)}
                                    >
                                        <EditIcon />
                                    </IconButton>
                                    <IconButton
                                        color="info"
                                        onClick={() => console.log('Ver Historia', paciente.idpersona)}
                                    >
                                        <FileCopyIcon />
                                    </IconButton>
                                </TableCell>
                                <TableCell>{paciente.apaterno}</TableCell>
                                <TableCell>{paciente.amaterno}</TableCell>
                                <TableCell>{paciente.nombre}</TableCell>
                                <TableCell>{paciente.fecha_nacimiento}</TableCell>
                                <TableCell>{paciente.sexo}</TableCell>
                                <TableCell>{paciente.estado_civil}</TableCell>
                                <TableCell>{paciente.num_documento}</TableCell>
                                <TableCell>{paciente.direccion}</TableCell>
                                <TableCell>{paciente.telefono}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    );
};

export default Pacientes;
